sprites.onOverlap(SpriteKind.Projectile, SpriteKind.EProjectile2, function (sprite, otherSprite) {
    if (sprites.readDataString(sprite, "Direction") == "L") {
        extraEffects.createSpreadEffectOnAnchor(sprite, myEffect4, 1)
        otherSprite.lifespan = 2000
        otherSprite.setVelocity(-200, -5)
        otherSprite.setKind(SpriteKind.Projectile2)
    } else if (sprites.readDataString(sprite, "Direction") == "R") {
        extraEffects.createSpreadEffectOnAnchor(sprite, myEffect5, 1)
        otherSprite.lifespan = 2000
        otherSprite.setVelocity(200, -5)
        otherSprite.setKind(SpriteKind.Projectile2)
    }
})
