forever(function () {
    for (let value of sprites.allOfKind(SpriteKind.Projectile2)) {
        if (value.vx == 0) {
            extraEffects.createSpreadEffectOnAnchor(value, extraEffects.createSingleColorSpreadEffectData(5, ExtraEffectPresetShape.Spark), 100)
            extraEffects.createSpreadEffectOnAnchor(value, extraEffects.createSingleColorSpreadEffectData(4, ExtraEffectPresetShape.Spark), 100)
            sprites.destroy(value)
        }
    }
    for (let value of sprites.allOfKind(SpriteKind.EProjectile2)) {
        if (value.vy == 0) {
            extraEffects.createSpreadEffectOnAnchor(value, extraEffects.createSingleColorSpreadEffectData(5, ExtraEffectPresetShape.Spark), 100)
            extraEffects.createSpreadEffectOnAnchor(value, extraEffects.createSingleColorSpreadEffectData(4, ExtraEffectPresetShape.Spark), 100)
            sprites.destroy(value)
        }
    }
})
